import React , {Component} from 'react'
import axios from 'axios';

class Blog extends Component{
    state = {
        users : []
    }
    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/users').then(res => {
            this.setState({
                users : res.data
            })
        })
    }

    render(){
        return(
            <div>
                <h2>Blog</h2>
                <p>This section from Blog</p>
            </div>
        );
    }
}

export default Blog;
